import "./Contact.css";


export default function Contact(){
 
    return (
        <div>
             <div className="wrapper">
                    <input  required type="text" id="fname" name="fname" placeholder="Full Name" /><br/>
                    <input  required type="contact" id="number" name="number" placeholder="Phone" /><br/>
                    <input  required type="email" id="email" name="email" placeholder="Email"/><br/>
                    <select type="email" placeholder="Are you a new customer"><option value="Yes">Yes</option><option value="No">No</option>       <option value="audi">Audi</option>     </select>
                    <input  required type="email" id="email" name="email" /><br/>
                </div>
        </div>
    )
}
